import React from 'react';

import Header from '../../header';
import Footer from '../../footer'
import '../../../css/pages/Contacts/contacts.scss';

function Contacts() {
  return (
    <>
      <div className="Contacts">
      <Header/>
        <div className="container">
          this is Contacts
        </div>
      <Footer/>
      </div>
    </>
  )
}

export default Contacts;
